As shown in the sensitivity analyses, the effect of interventions was tested by changing the annual number of non-locally acquired infections. In Scenario D, the estimated annual number of new male diagnoses would increase from 53 (-14% above base-case) in 2014 to 96 (46% above base-case) in 2023 when the number of non-locally acquired infections doubled (

